# works but time exceed limit
# @param {String} s
# @return {Integer}
def length_of_longest_substring(s)
  return 0 if s == ""
  return 1 if s.length == 1
  res = s[0]
  return helper(s,res,0,1).length
end

def helper(s,res,left,right)
  while right <= s.length-1
    if s[left..right-1].include?(s[right])
      left = left + s[left..right-1].index(s[right]) + 1
      res = s[left..right] if res.length <= right - left + 1
    else
      res = s[left..right] if res.length <= right - left + 1
    end
    right += 1
  end
  # binding.pry
  return res
end

